import React from 'react'
import ReactDOM from 'react-dom'
import Link from 'next/link'

const linkStyle = {
    marginRight: 15
}

class NavBar extends React.Component {
    render() {
        return (
            <div>
                <div className="Navbar">
                    <div>
                        <a href="/about">About</a>
                    </div>
                    <div>
                        <Link href="/resume">
                            <a>Resume</a>
                        </Link>
                    </div>
                </div>
                
            </div>
        )
    }
}


export default NavBar;
